import React from 'react';
import Hero from '../components/Hero';
import Content from '../components/Content';
function AboutPage(props){
return(

  <div>
          <Hero title={props.title} />
          <Content>
          <p>Hey Beautiful People! My name is Saigopini Panneerselvam, but I go by Sai (pronounced like "sigh"). I grew up in the Bay Area and when to college around there, double-majoring in math and computer science. It was hard being one of the only women in most of my classes but regardless,
          I kept my head up and discovered my passion for STEM during a hackathon held at my university. We created a platform that connects homeless shelters to restaurants in order feed hungry bellies in a sustainable way but cutting down food waste. It was then when I realized the instant gratification that comes from computer science and the power of technology to help our fellow human beings.
          I never had any experience in frontend development but in those 24 hours, I was able to contribute to something beautiful.
          I started working at a healthcare company with a mission that I'm incredibly passionate about straight out of graduation and stumbled into the field of data science. </p>
          <p>I try to live everyday with a growth mindset: taking everything that life throws my way as a learning opportunity built this platform to showcase some of interests such as coding, travel, </p>

          <p>I'm constantly learning new things. currently those things include gaining more experience with MongoDB, React, Express JS, and Node JS</p>

          <p>My latest project, Dev Grub, is a cookbook for developers. You can check it out <a href="https://devgrub.com" target="_blank" rel="noopener noreferrer">here</a>, or on the homepage. It is built with Angular, MongoDB, Express JS, and Node JS. However, I will be rebuilding it using React in the coming months</p>

          <p>When I'm not learning something new chances are I'm creating some YouTube videos. You can find those <a href="http://www.youtube.com/c/GarrettLove1" target="_blank" rel="noopener noreferrer">here</a></p>
          </Content>
      </div>

);
}
export default AboutPage;
